import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

export default function AdminDashboard() {
  const [complaints, setComplaints] = useState([]);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const fetchComplaints = async () => {
      try {
        const res = await axios.get("http://localhost:5000/api/admin/complaints", {
          withCredentials: true,
        });
        if (res.data.success) {
          setComplaints(res.data.complaints);
        } else {
          setError(res.data.message);
        }
      } catch (err) {
        setError("Failed to fetch complaints");
      }
    };

    fetchComplaints();
  }, []);

  // Stats
  const total = complaints.length;
  const resolved = complaints.filter((c) => c.status.toLowerCase() === "resolved").length;
  const pending = total - resolved;

  const handleLogout = () => {
    localStorage.removeItem("isAdmin");
    navigate("/admin-login");
  };

  return (
    <div className="p-6">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-3xl font-bold">🛡️ Admin Dashboard</h1>
        <button
          onClick={handleLogout}
          className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
        >
          Logout
        </button>
      </div>

      {/* 🔢 Stats Summary */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-8">
        <div className="bg-blue-100 p-4 rounded shadow">
          <h2 className="text-xl font-semibold">📋 Total Complaints</h2>
          <p className="text-2xl font-bold">{total}</p>
        </div>
        <div className="bg-green-100 p-4 rounded shadow">
          <h2 className="text-xl font-semibold">✅ Resolved</h2>
          <p className="text-2xl font-bold">{resolved}</p>
        </div>
        <div className="bg-yellow-100 p-4 rounded shadow">
          <h2 className="text-xl font-semibold">⏳ Pending</h2>
          <p className="text-2xl font-bold">{pending}</p>
        </div>
      </div>

      {error && <p className="text-red-600 mb-4">{error}</p>}

      {/* 📑 Complaints Table */}
      <div className="overflow-x-auto">
        <table className="min-w-full border border-gray-300">
          <thead className="bg-gray-200">
            <tr>
              <th className="py-2 px-4 border">ID</th>
              <th className="py-2 px-4 border">Name</th>
              <th className="py-2 px-4 border">Location</th>
              <th className="py-2 px-4 border">Department</th>
              <th className="py-2 px-4 border">Status</th>
              <th className="py-2 px-4 border">Token</th>
              <th className="py-2 px-4 border">Date</th>
            </tr>
          </thead>
          <tbody>
            {complaints.map((c) => (
              <tr key={c.id} className="text-center hover:bg-gray-100">
                <td className="py-2 px-4 border">{c.id}</td>
                <td className="py-2 px-4 border">{c.name}</td>
                <td className="py-2 px-4 border">{c.location}</td>
                <td className="py-2 px-4 border">{c.department}</td>
                <td className="py-2 px-4 border">{c.status}</td>
                <td className="py-2 px-4 border text-xs">{c.token}</td>
                <td className="py-2 px-4 border text-sm">
                  {new Date(c.timestamp).toLocaleString()}
                </td>
              </tr>
            ))}
            {complaints.length === 0 && !error && (
              <tr>
                <td colSpan="7" className="py-4 text-center text-gray-500">
                  No complaints found.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}
